import "./ExpenseItem.css";

const ExpenseItem = () => {
  return (
    <div>
      <div className="expense-item">March 28th 2021</div>
      <div className="expense-item__description">
        <h2>Car Insurance</h2>
        <div expense-item__price>$294.67</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
